script:
// TEMPORARY IOS VS ANDROID HANDLER
var previewSetting = $("#previewWrapper").css("top").split("px")[0];
$("#chapterSelect").css("bottom", parseInt(135) + parseInt(previewSetting) + "px");

// GET ALL CHAPTERS BY ID AND CREATE SELECT OPTIONS
var chapterList = [];
$("g#Chapter").children("g").each(function(){
	var chapterLabel = $(this).attr("id"); // ORIGINAL ID STRING
	var chapterName = chapterLabel.split(/(?=[A-Z])/).join(" ").replace("Of", "of").replace("The", "the").replace(" A ", " a ").replace(" M a ", " M A ").replace("_", "").replace(" Old", " (old)").replace("Pre Heresy", "(Pre Heresy)"); // CORRECT WRITING CAPS AND 
	// CHECK IF MULTI GROUPS
	if(chapterName.indexOf("1")>=0){
		// IF IS SET OF SELECTION AREAS (ENDS WITH "[...]1")
		optionID = chapterLabel.split("1")[0];
		chapterName = chapterName.split("1")[0];
		var chapterName = chapterName;
		chapterList.push(chapterName);
		$("#chapterSelect").append('' + chapterName + '')
	}else if(chapterName.indexOf("2")>=0){
		// IGNORE THIS ITEM
	}else if(chapterName.indexOf("3")>=0){
		// IGNORE THIS ITEM
	}else if(chapterName.indexOf("4")>=0){
		// IGNORE THIS ITEM
	}else{
		// IF SINGLE AREA ITEM (NO NUMMERICAL SUFFIX)
		$("#chapterSelect").append('' + chapterName + '')
		chapterList.push(chapterName);
	};
});
// *** END OPTION VALUES ***
console.log(chapterList);

// APPEND ALL OUTPUT LAYERS WITH SELECTED BADGE CONTENT
var chapterID = "none";
$("g#Chapter").css("display", "none"); // HIDE ALL INITIAL CHAPTER ITEMS

$(document).on("change", "#chapterSelect", function(){
	chapterID = $(this).children("option:selected").val();

	// CLEAR ALL BADGE ELEMENT CONTENTS FROM SCENE
	$("#Badge1").html("");
	$("#Badge1_B").html("");
	$("#Badge1_L").html("");
	$("#Badge1_S").html("");
	$("#Badge1_H").html("");
	$("#Badge1_M").html("");
	$("#Badge2").html("");
	$("#Badge2_B").html("");
	$("#Badge2_L").html("");
	$("#Badge2_S").html("");
	$("#Badge2_H").html("");
	$("#Badge2_M").html("");
	$("#Badge3").html("");
	$("#Badge3_B").html("");
	$("#Badge3_L").html("");
	$("#Badge3_S").html("");
	$("#Badge3_H").html("");
	$("#Badge3_M").html("");

	// COPY BADGE DATA TO MODEL AREAS
	$("g#Chapter").children().each(function(){
		if($(this).attr("id").indexOf(chapterID)>=0){
			var groupID = $(this).attr("id");

			// REDEFINE BADGE ELEMENT CONTENT
			if(groupID.indexOf("1")>=0){
				var groupID1 = $(this).attr("id");
				var groupContent1 = $(this).html();

				$("#Badge1").html(groupContent1);
				$("#Badge1_B").html(groupContent1);
				$("#Badge1_L").html(groupContent1);
				$("#Badge1_S").html(groupContent1);
				$("#Badge1_H").html(groupContent1);
				$("#Badge1_M").html(groupContent1);
			}else if(groupID.indexOf("2")>=0){
				var groupID2 = $(this).attr("id");
				var groupContent2 = $(this).html();

				$("#Badge2").html(groupContent2);
				$("#Badge2_B").html(groupContent2);
				$("#Badge2_L").html(groupContent2);
				$("#Badge2_S").html(groupContent2);
				$("#Badge2_H").html(groupContent2);
				$("#Badge2_M").html(groupContent2);
			}else if(groupID.indexOf("3")>=0){
				var groupID3 = $(this).attr("id");
				var groupContent3 = $(this).html();

				$("#Badge3").html(groupContent3);
				$("#Badge3_B").html(groupContent3);
				$("#Badge3_L").html(groupContent3);
				$("#Badge3_S").html(groupContent3);
				$("#Badge3_H").html(groupContent3);
				$("#Badge3_M").html(groupContent3);
			};
		};
	});
	// FIX METALLIC
	$("#Badge1_M path").css("fill", "black");
	$("#Badge2_M path").css("fill", "black");
	$("#Badge3_M path").css("fill", "black");


});
